{
  "translationLines": [
    {
      "lineNumber": 80241,
      "originalJapaneseLine": "「駄目だ駄目だ。」",
      "translatedEnglishLine": "\"No, no.\""
    },
    {
      "lineNumber": 80242,
      "originalJapaneseLine": "　そんなことぜーったいにせんぞ」",
      "translatedEnglishLine": "I absolutely won't do such a thing.\""
    },
    {
      "lineNumber": 80243,
      "originalJapaneseLine": "「いえ、最初から無意味です」",
      "translatedEnglishLine": "\"No, it’s meaningless from the start.\""
    },
    {
      "lineNumber": 80244,
      "originalJapaneseLine": "「美樹さんを殺しても……",
      "translatedEnglishLine": "\"Even if you kill Miki-san...\""
    },
    {
      "lineNumber": 80245,
      "originalJapaneseLine": "　なにも解決しませんから」",
      "translatedEnglishLine": "Nothing will be solved.\""
    },
    {
      "lineNumber": 80246,
      "originalJapaneseLine": "「何故だ？」",
      "translatedEnglishLine": "\"Why?\""
    },
    {
      "lineNumber": 80247,
      "originalJapaneseLine": "「なんでもです」",
      "translatedEnglishLine": "\"Because that’s just how it is.\""
    },
    {
      "lineNumber": 80248,
      "originalJapaneseLine": "「残念ながら、",
      "translatedEnglishLine": "\"Unfortunately,\""
    },
    {
      "lineNumber": 80249,
      "originalJapaneseLine": "　そういう風にこの世は出来ています」",
      "translatedEnglishLine": "the world is made that way.\""
    },
    {
      "lineNumber": 80250,
      "originalJapaneseLine": "「……よく分からんが、",
      "translatedEnglishLine": "\"...I don’t really understand, but\""
    },
    {
      "lineNumber": 80251,
      "originalJapaneseLine": "　まあ、お前が言うならそうなんだろうな」",
      "translatedEnglishLine": "well, if you say so, then it must be true.\""
    },
    {
      "lineNumber": 80252,
      "originalJapaneseLine": "「なら、それ以外の解決策を見つけるだけだ」",
      "translatedEnglishLine": "\"Then, we just have to find another solution.\""
    },
    {
      "lineNumber": 80253,
      "originalJapaneseLine": "「ランス様、何か策があるんですか？」",
      "translatedEnglishLine": "\"Master Rance, do you have any plan?\""
    },
    {
      "lineNumber": 80254,
      "originalJapaneseLine": "「クルックーもミラクルも",
      "translatedEnglishLine": "\"Things that Klook and Miracle haven’t even tried,\""
    },
    {
      "lineNumber": 80255,
      "originalJapaneseLine": "　試さなかったようなことをあれこれ試す」",
      "translatedEnglishLine": "we’ll try all sorts of things like that.\""
    },
    {
      "lineNumber": 80256,
      "originalJapaneseLine": "「まずはお湯でもぶっかけてみよう。",
      "translatedEnglishLine": "\"First, let's try pouring hot water on her."
    },
    {
      "lineNumber": 80257,
      "originalJapaneseLine": "　それが駄目なら冷水もかける」",
      "translatedEnglishLine": "If that doesn’t work, then cold water.\""
    },
    {
      "lineNumber": 80258,
      "originalJapaneseLine": "「……カオスマスター、",
      "translatedEnglishLine": "\"...Chaos Master,"
    },
    {
      "lineNumber": 80259,
      "originalJapaneseLine": "　ふざけているわけではないよな？」",
      "translatedEnglishLine": "you’re not joking, right?\""
    },
    {
      "lineNumber": 80260,
      "originalJapaneseLine": "「大真面目だ馬鹿者！」",
      "translatedEnglishLine": "\"I’m dead serious, idiot!\""
    },
    {
      "lineNumber": 80261,
      "originalJapaneseLine": "「お前らがしてなさそうなことと言ったら",
      "translatedEnglishLine": "\"If you say things we haven’t tried yet,"
    },
    {
      "lineNumber": 80262,
      "originalJapaneseLine": "　もうそういうアホらしいことしかなかろう」",
      "translatedEnglishLine": "there’s probably nothing left but such foolish things.\""
    },
    {
      "lineNumber": 80263,
      "originalJapaneseLine": "「おい、誰か牛乳を大量に用意しろ。",
      "translatedEnglishLine": "\"Hey, someone get a large amount of milk ready."
    },
    {
      "lineNumber": 80264,
      "originalJapaneseLine": "　漬け込んでみる」",
      "translatedEnglishLine": "We’ll try soaking her in it.\""
    },
    {
      "lineNumber": 80265,
      "originalJapaneseLine": "「くさみ抜きか？」",
      "translatedEnglishLine": "\"To remove the smell?\""
    },
    {
      "lineNumber": 80266,
      "originalJapaneseLine": "「えーい、茶化すな！」",
      "translatedEnglishLine": "\"Hey, don’t mock me!\""
    },
    {
      "lineNumber": 80267,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "…………"
    },
    {
      "lineNumber": 80268,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "……"
    },
    {
      "lineNumber": 80269,
      "originalJapaneseLine": "ランス達は思いつく限りの対策を講じてみたが、",
      "translatedEnglishLine": "Rance and the others tried every possible countermeasure,"
    },
    {
      "lineNumber": 80270,
      "originalJapaneseLine": "魔王化を止めることは出来なかった。",
      "translatedEnglishLine": "but they could not stop the transformation into the Demon King."
    },
    {
      "lineNumber": 80271,
      "originalJapaneseLine": "「はあはあ……",
      "translatedEnglishLine": "\"Haa, haa...\""
    },
    {
      "lineNumber": 80272,
      "originalJapaneseLine": "　くそ、これだけやって駄目か……」",
      "translatedEnglishLine": "Damn, after all that, it’s no good...\""
    },
    {
      "lineNumber": 80273,
      "originalJapaneseLine": "「うう……このままじゃ……",
      "translatedEnglishLine": "\"Ugh... if this keeps up...\""
    },
    {
      "lineNumber": 80274,
      "originalJapaneseLine": "　本当に美樹ちゃんが魔王に……」",
      "translatedEnglishLine": "Miki-chan will really become the Demon King...\""
    },
    {
      "lineNumber": 80275,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 80276,
      "originalJapaneseLine": "「シィル、部屋に戻るぞ」",
      "translatedEnglishLine": "\"Seal, let’s go back to the room.\""
    },
    {
      "lineNumber": 80277,
      "originalJapaneseLine": "「えっ？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 80278,
      "originalJapaneseLine": "「飽きた。セックスする」",
      "translatedEnglishLine": "\"I’m bored. Let’s have sex.\""
    },
    {
      "lineNumber": 80279,
      "originalJapaneseLine": "「え、ええっ……」",
      "translatedEnglishLine": "\"Eh, ehh...\""
    },
    {
      "lineNumber": 80280,
      "originalJapaneseLine": "「待って下さい、総統！",
      "translatedEnglishLine": "\"Please wait, Commander!"
    },
    {
      "lineNumber": 80281,
      "originalJapaneseLine": "　そんな無責任な！」",
      "translatedEnglishLine": "That’s so irresponsible!\""
    },
    {
      "lineNumber": 80282,
      "originalJapaneseLine": "「百発はやるぞー」",
      "translatedEnglishLine": "\"I’ll do it a hundred times!\""
    },
    {
      "lineNumber": 80283,
      "originalJapaneseLine": "「あっ、この……」",
      "translatedEnglishLine": "\"Ah, um...\""
    },
    {
      "lineNumber": 80284,
      "originalJapaneseLine": "「気にするな、クリーム・ガノブレード。",
      "translatedEnglishLine": "\"Don’t worry about it, Cream Ganoblade."
    },
    {
      "lineNumber": 80285,
      "originalJapaneseLine": "　カオスマスターにそっち方面で期待は",
      "translatedEnglishLine": "Neither I nor the Pope have any expectations of Chaos Master in that area."
    },
    {
      "lineNumber": 80286,
      "originalJapaneseLine": "　余も法王もしておらん」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 80287,
      "originalJapaneseLine": "「そうですね」",
      "translatedEnglishLine": "\"That’s true.\""
    },
    {
      "lineNumber": 80288,
      "originalJapaneseLine": "「ああ、もう……」",
      "translatedEnglishLine": "\"Ah, geez...\""
    },
    {
      "lineNumber": 80289,
      "originalJapaneseLine": "頭痛を抑えるように、",
      "translatedEnglishLine": "Trying to relieve her headache,"
    },
    {
      "lineNumber": 80290,
      "originalJapaneseLine": "クリームが頭を手で押さえる。",
      "translatedEnglishLine": "Cream held her head with her hands."
    }
  ]
}

